/**
 * Diffs two objects
 *
 * @param {Record<string, any>} propsDefault     default props
 * @param {Record<string, any>} propsNew         new props
 * @return {Record<string, any>}
 */
export function resolvePropsDif(propsDefault: Record<string, any>, propsNew: Record<string, any>): Record<string, any>;

/**
 * Merges two objects
 *
 * @param {Record<string, any>} propsDefault  default props
 * @param {Record<string, any>} props         props
 * @return {Record<string, any>}
 */
export function mergeProps(propsDefault: Record<string, any>, props: Record<string, any>): Record<string, any>;
